    }

    render() {
        return (
            <>
                <div className="navbar">
                    <ButtonGroup>
                        {TAG_NAMES.map(name => (<TagButton name={name} />))}
                    </ButtonGroup>
                </div>
                <div className="content">
                </div>
            </>

        );
    }
}


//Returns a new button with a given name
class TagButton extends react.Component {

    constructor(props) {
        super(props);
        this.name = props.name;
    }

    render() {
        return (
            <Button className="mx-2" size="sm">{this.name}</Button>
        );
    }
}

export default Home;
